import React from 'react';

import { Select, InputLabel, MenuItem } from '@mui/material';

const SelectorUnit = () => {
  const [unit, setUnit] = useState(1);
  const handleChange = (event) => {
    setUnit(event.target.value);
  };

  return (
    <>
      <InputLabel style={{ fontWeight: 'bold' }}>Σώμα</InputLabel>
      <Select
        onChange={handleChange}
        value={unit}
        style={{
          width: '12.5dvw'
        }}
      >
        <MenuItem value={1}>ΠΟΛΕΜΙΚΗ ΑΕΡΟΠΟΡΙΑ</MenuItem>
        <MenuItem value={2}>ΣΤΡΑΤΟΣ ΞΗΡΑΣ</MenuItem>
        <MenuItem value={3}>ΠΟΛΕΜΙΚΟ ΝΑΥΤΙΚΟ</MenuItem>
      </Select>
    </>
  )
}

export default SelectorUnit;
